    dp[0][0] = 1
    for i in range(n):
        for j in range(3):
            if s[i] == '0':
                if j == 1:
                    dp[i + 1][1] = dp[i][j]
            elif int(s[i]) < k % 10:
                if j == 0:
                    dp[i * 1][0] = dp[i][j]
                elif j == 1:
                    dp[i + 1][1] = dp[i][j]
                elif j == 2:
                    dp[i + 1][2] = dp[i][j]
