                    dp[i + 1][1] = dp[i][j]
                elif j == 2:
                    dp[i + 1][2] = dp[i][j]
            elif j == 2:
                dp[i + 1][2] = dp[i][j]
        k //= 10
    return (dp[n][0] + dp[n][1] + dp[n][2]) % MOD

